import React, { useState } from 'react';
import './App.css';
import ReactMapGL from 'react-map-gl';
// import Root from './component/map/map';

const MAPBOX_TOKEN =
	'pk.eyJ1IjoiYm95cGVyZmVyIiwiYSI6ImNrOGF5aGRybDAzOGcza293NXI0OGNodTAifQ.k1EdkowgT451b0uqW-kQHw';

function App() {
	const [viewPort, setViewPort] = useState({
		width: '100%',
		height: 900,
		latitude: 0,
		longitude: 0,
		zoom: 2
	});

	return (
		<ReactMapGL
			{...viewPort}
			mapStyle='mapbox://styles/mapbox/dark-v10'
			onViewportChange={setViewPort}
			mapboxApiAccessToken={MAPBOX_TOKEN}
		/>
	);
}

export default App;
